import React, { useState } from "react";
import { ReactTitle } from "react-meta-tags";
import { Navbar } from "../../componentes/Navbar";
import { Header } from "../../componentes/Header";
import { Footer } from "../../componentes/Footer";
import { Barra } from "../../componentes/BarraMitad";
import { SignupForm } from "../../componentes/FormSignup";
import "bootstrap/dist/css/bootstrap.css";

export const SignUpPH = () => {
  const [formData, setFormData] = useState({
    email: "",
    password: "",
    confirmPassword: "",
    nombre: "",
    apellido: "",
  });

  const handleChange = (e) => {
    const { id, value } = e.target;
    setFormData((prevData) => ({
      ...prevData,
      [id]: value,
    }));
  };

  const handleSubmit = (e) => {
    e.preventDefault();

    // You can access the form data in the 'formData' object
    console.log("Form data submitted:", formData);

    // Here, you can add your logic to handle the form data as needed,
    // such as saving it to local storage or performing any other actions.

    // For example, you can save the data to local storage:
    // localStorage.setItem("signupData", JSON.stringify(formData));
  };

  return (
    <div className="loginpage">
      <ReactTitle title="Registro" />
      <Navbar />
      <Header />
      <Barra titulo="Registro" />
      <SignupForm />

      <Footer />
    </div>
  );
};
